script: |
  super -f text -I q815.spq | sort > q815.out

inputs:
  - name: q815.spq
    data: |
      SELECT DISTINCT - col1 FROM tab0 (FORMAT parquet) cor0 WHERE NOT - 32 * + col2 * + col2 - - 64 > col1 * + col0 + - + col0 * + 27 + + 26 - - 74 * - 52;
  - name: tab0

outputs:
  - name: q815.out
    data: |
      -1
      -81
